import ColumnFilter from './ColumnFilter';

let COLUMNS = [
    {
        Header: 'Name',
        accessor: 'full_name',
        Filter: ColumnFilter,
        disableFilters: true,
        sortable: false
    },
    {
        Header: 'Pos',
        accessor: 'pos',
        Filter: ColumnFilter,
        sortable: false
    },
    {
        Header: 'Ovr',
        accessor: 'ovr',
        Filter: ColumnFilter,
        disableFilters: true,
    }
];

export {COLUMNS};
